import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import  get  from 'lodash/get';
import  size  from 'lodash/size';
import  isEmpty  from 'lodash/isEmpty';
import * as serviceWorker from './serviceWorker';

class Covid extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
			covidData: {}
    };
  }

  render(){
		let covid = this.state.covidData;
		let date = "";

		if (!isEmpty(covid)) {
			let thai = covid.Thailand;
			if (!isEmpty(thai)) {
				console.log(thai[0]);
				date = thai[0].date;
			}
		}
		let options = [];
		for (let i = 0; i<2;i++) {
			options.push(
				<div>
				`${date} hello`
			</div>
			);
		}
	  return (
			<div>
				{options}
			</div>
    );
	}
	componentDidMount(){
		document.title = "Covid Update";
		fetch('https://pomber.github.io/covid19/timeseries.json')
		.then(results => {
				return results.json();
		}).then(data => {
			this.setState({
				covidData: data
			});
		});
  }
}

ReactDOM.render(
  <Covid />,
  document.getElementById('root')
);

serviceWorker.unregister();
